import React from 'react';
import styled from 'styled-components';


const Table = styled.table`
width: 100%
background-color: #fff
padding: 20px;
box-shadow: 0px 0px 5px #ccc;
border-radius: 5px;
max-width: 800px;

`;

const Grid = () => {
    return (
        <Table></Table>
    );
}

export default Grid;
